import './App.css';
import Data from "bootstrap/js/src/dom/data";
import {Route, BrowserRouter as Router, Routes} from "react-router-dom";

const App = () => {

  return (
    <div className="App">
      <Router>
          <Routes>
            <Route path="/" element={<Data/>} />
          </Routes>
      </Router>
    </div>
  );
}

export default App;
